import React from "react";
import { Box } from "@chakra-ui/core";

interface NavBarProps {}

const NavBar: React.FC<NavBarProps> = ({}) => {
  return (
    <Box bg="tomato" p={4} ml={auto}>
      Cool navbar
    </Box>
  );
};

export default NavBar;
